import { Link, useHistory } from "react-router-dom";
import {NavBarContext} from "../../App";

const Navbar = () => {

    const [type, navBarState] = useContext(NavBarContext);

   if(type === 'login') {
        return (
             <nav>
    <div className="nav-wrapper">
        <div className="nav__heading">
                 <h2>Welcome to Twimbit blogs</h2>
          </div>
      <ul id="nav-mobile" className="right hide-on-med-and-down">
        <Link to='/register' onClick={() => navBarState('register')} style={{ textDecoration: 'none', color: 'white'}}>
                    <h4>Don't have an account...Register here!</h4>
        </Link>
      </ul>
    </div>
  </nav>
        // <nav className="nav__bar">
