        //             <h4>Don't have an account...Register here!</h4>
        //         </Link>
        //     </div>
        // </nav>  
    );
   } else if(type === 'register') {
        return (
        <nav className="nav__bar">
            <div className="nav__heading">
                <h2>Welcome to Twimbit blogs</h2>
            </div>
            <div className="nav__link">
                <Link to='/login' onClick={() => navBarState('login')} style={{ textDecoration: 'none', color: 'white'}}>
                    <h4>Login!</h4>
                </Link>
            </div>
        </nav>
    );
   }
}

export default Navbar;
